import React, { useState } from 'react';

const Register: React.FC = () => {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [error, setError] = useState('');

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();

    if (password !== confirmPassword) {
      setError('Parolele nu coincid.');
      return;
    }

    alert('Înregistrare realizată cu succes!');
  };

  return (
    <div
      className="min-h-screen bg-cover bg-center flex items-center justify-center p-6"
      style={{ backgroundImage: "url('/images/background-casino.jpg')" }}
    >
      <div className="max-w-md w-full bg-black bg-opacity-70 rounded-md shadow-md p-6 text-white">
        <h1 className="text-2xl font-bold mb-6 text-center">Înregistrare</h1>
        <form onSubmit={handleSubmit}>
          <label className="block mb-2 font-semibold">
            Username
            <input
              type="text"
              className="w-full border border-gray-300 px-3 py-2 mt-1 rounded text-black"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              required
            />
          </label>

          <label className="block mb-2 font-semibold">
            Email
            <input
              type="email"
              className="w-full border border-gray-300 px-3 py-2 mt-1 rounded text-black"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </label>

          <label className="block mb-2 font-semibold">
            Parola
            <input
              type="password"
              className="w-full border border-gray-300 px-3 py-2 mt-1 rounded text-black"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
          </label>

          <label className="block mb-4 font-semibold">
            Confirmă parola
            <input
              type="password"
              className="w-full border border-gray-300 px-3 py-2 mt-1 rounded text-black"
              value={confirmPassword}
              onChange={(e) => setConfirmPassword(e.target.value)}
              required
            />
          </label>

          {error && <p className="text-red-500 mb-4">{error}</p>}

          <button
            type="submit"
            className="w-full bg-green-600 py-2 rounded hover:bg-green-700"
          >
            Înregistrează-te
          </button>
        </form>
      </div>
    </div>
  );
};

export default Register;
export {};
